window.bookSummaryJSON = "<p><b>I was supposed to have it all.</b></p> <p>I’d been prom queen and cheer captain—high school’s most savage Queen Bee. I could have everything I wanted.</p> <p>Except them. The freaks, the weirdos, the school’s ultimate losers: Manson, Jason, Lucas, and Vincent. Our hatred for each other couldn’t keep us apart, not even when my own mistake got Manson expelled and made me the ultimate villain to the rest of them.</p> <p><b>One night was supposed to be enough.</b></p> <p>I couldn’t resist forever. For one night, I gave myself over to the men I wasn’t supposed to want and satisfied the darkest parts of my soul. But some things are meant to stay in the dark. One night and it was over.</p> <p><b>Nothing more than a game.</b></p> <p>Now, with college behind me, our worlds collide yet again. Four men, all willing to share me as their plaything until my debt to them is paid. Another game to satiate my dark cravings, the twisted rules of which bring us all even closer than before. But games aren’t meant to last.</p> <p><b>When the debt is paid and the game is done, what if I don’t want to walk away?</b></p> <p><i>Losers: Part 1</i> is book one in the Losers duet. Although not required, it is recommended to listen to the novella <i>The Dare</i> before listening to <i>Losers: Part 1</i>.</p> <p>Contains mature content.</p>"; 
